def circular_binary_search(data, search_num):
    low = 1
    high = len(data) - 1
    while low <= high:
        mid = (low + high) // 2
        if data[mid] == search_num:
            return mid
        if data[low] <= data[mid]:
            if data[low] <= search_num < data[mid]:
                high = mid - 1
            else:
                low = mid + 1
        elif data[mid] < search_num <= data[high]:
            low = mid + 1
        else:
            high = mid - 1
    return -1

